import React from 'react';
import {
	BrowserRouter,
	Route,
	Switch
} from 'react-router-dom';

import HomeView from '../HomeView/HomeView';
import AboutMeView from '../AboutMeView/AboutMeView';
import BlogView from '../BlogView/BlogView';
import ContactView from '../ContactView/ContactView';
import PortfolioView from '../PortfolioView/PortfolioView';
import PortfolioAppMobileView from '../PortfolioView/PortfolioAppMobileView/PortfolioAppMobileView';

const Root = () => ( <
	BrowserRouter >
	<
	Switch >
	<
	Route exact path = "/"
	component = {
		HomeView
	} > < /Route> <
	Route path = "/about-me"
	component = {
		AboutMeView
	} > < /Route> <
	Route path = "/blog"
	component = {
		BlogView
	} > < /Route> <
	Route path = "/contact"
	component = {
		ContactView
	} > < /Route> <
	Route exact path = "/portfolio/"
	component = {
		PortfolioView
	} > < /Route> <
	Route exact path = "/portfolio/aplikacje-mobilne"
	component = {
		PortfolioAppMobileView
	} >
	< /Route> <
	/Switch> <
	/BrowserRouter>
);

export default Root;
